window.bookSummaryJSON = "<p>One man. Assassin. Caster. A new world. And a game that is as brutal as it is complex.</p> <p>Michael finds himself in the realm of the Forever Kingdom, with no memory of how he got there and who he is. Even so, he must participate in the Grand Game and forge a new destiny for himself.</p> <p>Dropped into a dungeon of monsters and strange magics, would you survive in a game where to lose means death?</p> <p>Alone, and with little more than his wits to aid him, Michael must advance as a player, slay his foes, and gain experience. All while navigating the intrigues around him and discovering his purpose.</p> <p>A world of powers, forces, and mysterious factions. A game with endless opportunities for advancement and power.</p> <p>Join Michael on his epic adventure as he deals with the game's challenges, the machinations of the powers, and the ambitions of his fellow players.</p> <p>The start of an exciting new portal fantasy epic!</p>"; 
